// import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
// import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';
import '../Components/Search.css';
import IC from '../image/IC logo.png'

//For Demo only
var links = document.getElementsByClassName('link')
for(var i = 0; i <= links.length; i++)
   addClass(i)


function addClass(id){
   setTimeout(function(){
      if(id > 0) links[id-1].classList.remove('hover')
      links[id].classList.add('hover')
   }, id*750) 
}

function OffcanvasExample() {
 

  return (


    <>
      
      {[false].map((expand) => (
        
        <Navbar key={expand} bg="light" expand={expand} className="mb-3">
          
         
          <Container fluid>
            <img className="App-logo" src={IC} style={{width:"50", height:"50"}} alt="IC Logo"/>
            <Navbar.Brand href="#" style={{fontSize:"32px", fontWeight:"normal", color:"#8b2266"}}>INDIAN CULTURE</Navbar.Brand>
            <form className="w-75 text-end">
            <input type="text" className="border" placeholder="Universal Search..."  element/>
           </form>
           
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} style={{marginRight:'10px'}}/>

            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >

           
           {/* <form className="">
               <input type="text" className="border" placeholder="Search" />
           </form> */}
           
            <Navbar.Brand href="#" style={{margin:"auto", fontSize:"30px", fontWeight:"normal", color:"#8b2266"}}><img className="App-logo-side" src={IC} style={{width:"50", height:"50", margin:"10px"}} alt="IC Logo"/>INDIAN CULTURE</Navbar.Brand>
              {/* <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  CATAGORIES
                </Offcanvas.Title>
              </Offcanvas.Header> */}
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3 menuit ">
                 <div className="itemeffect"> <Nav.Link  href="#action1">Forts Of India</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Historic Cities</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Photo Essay</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Textile and Fabrics of India</Nav.Link>

                  <Nav.Link className="itemeffect" href="#action1">Rarebook</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">E-Book</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Food and culture</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Gazetter</Nav.Link>

                  <Nav.Link className="itemeffect" href="#action1">Images</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Snippets</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Archives</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">UNSECO</Nav.Link>

                  <Nav.Link className="itemeffect" href="#action1">Video</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Story</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Manuscript</Nav.Link>
                  <Nav.Link className="itemeffect" href="#action2">Paintings</Nav.Link></div>
                  <div className="itemeffect"><NavDropdown
                    title="Other Catagories"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item className="itemeffect" href="#action3">List1</NavDropdown.Item>
                    <NavDropdown.Item className="itemeffect" href="#action4">List2</NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item className="itemeffect" href="#action5">
                      Other
                    </NavDropdown.Item>
                  </NavDropdown></div>
                </Nav>
                

              </Offcanvas.Body>
              
              
            </Navbar.Offcanvas>
           
          </Container>


        </Navbar>
        
      ))}
      <div style={{width:'100%', flex: 1, height: '8px', backgroundColor: '#8b2266 ', margin: '-11px', marginTop:'-17px', marginLeft:'0px'}} />

    </>

  );


}


export default OffcanvasExample;
